//  inputinputNumbas
float activation_Sigma(float input,float bas) // sigma
{
	float temp=input+bas;
	return (float)1.0/((float)(1.0+exp(-temp)));
}
float activation_relu(float input, float bas){
	float temp = input + bas;
	if (temp > 0){ return temp; }
	else return 0;
}
void avgPooling(float** output,nSize outputSize,float** input,nSize inputSize,int mapSize) // 
{
	int outputW=inputSize.c/mapSize;
	int outputH=inputSize.r/mapSize;
	if(outputSize.c!=outputW||outputSize.r!=outputH)
		printf("ERROR: output size is wrong!!");

	int i,j,m,n;
	for(i=0;i<outputH;i++)
		for(j=0;j<outputW;j++)
		{
			float sum=0.0;
			for(m=i*mapSize;m<i*mapSize+mapSize;m++)
				for(n=j*mapSize;n<j*mapSize+mapSize;n++)
					sum=sum+input[m][n];

			output[i][j]=sum/(float)(mapSize*mapSize);
		}
}
void maxPooling(float** output, nSize outputSize, float** input, nSize inputSize, int mapSize) // 
{
	int outputW = inputSize.c / mapSize;
	int outputH = inputSize.r / mapSize;
	if (outputSize.c != outputW || outputSize.r != outputH)
		printf("ERROR: output size is wrong!!");

	int i, j, m, n;
	for (i = 0; i<outputH; i++)
	for (j = 0; j<outputW; j++)
	{
		float sum = 0.0;
		for (m = i*mapSize; m<i*mapSize + mapSize; m++)
		  for (n = j*mapSize; n<j*mapSize + mapSize; n++)
		     if (sum < input[m][n]){ sum = input[m][n]; }

		output[i][j] = sum ;
	}
}
void nnff(float* output,float* input,float** wdata,float* bas,nSize nnSize)
{
	int w=nnSize.r;//10
	int h=nnSize.c;//588
	int i;
	for (i = 0; i < w; i++){
		for (int j = 0; j < h; j++)
		{
			output[i] = output[i] + input[j] * wdata[j][i];
		}
	}
}
